      <path
        stroke="currentColor"
        strokeWidth="2"
        fill="none"
        strokeLinecap="round"
        strokeLinejoin="round"
        d="M20.2688,28.2021l-1.5169,1.7087a8.3516,8.3516,0,1,1,0-11.8216L29.2481,29.9108a8.3516,8.3516,0,1,0,0-11.8216l-1.5169,1.7087"
      />
    </svg>
  );
}

export default LogoIcon;
